(1, 'READYMADE MEN\'S KURTA WITH DHOTI-HIT COLLECTION COLORS', 'men', 'men-topwear', 2340, 'Product Name - Readymade Men\'s Kurta With Dhoti Hit Collection Colors, Brand - Roykals, Stitching Type - Stitched, Package Details - 1 Kurta / 1 Pajama, Other Details: Work - Embroidered, Sleeve - Full Sleeve, Neck Style - Round Neck, Top Color - White, Top Fabric - Silk.', '2024-02-10', 'clothingsite/images/0001-1.jpg', 'clothingsite/images/0001-2.jpg', NULL, '', '', '', '', '', '', '', ''),
(2, 'GOLD DUPION SILK PRINTED NEHRU STYLE JACKET', 'men', 'men-topwear', 1495, 'Veera Paridhaan Golden Printed Banarasi Nehru Jacket Veera Paridhaan Is A Modern Men\'s Fashion Brand Known For Exceptional Craftsmanship And Contemporary Tailoring. Nehru Jacket Also Known As Jawahar Cut For Mens Gives The Perfect Look For Formal To Casual Occasions With The High Quality Blended Fab', '2024-02-10', 'clothingsite/images/0002-1.jpg', 'clothingsite/images/0002-2.jpg', NULL, '', '', '', '', '', '', '', ''),
(3, 'BLACK PLAIN COTTON BANDHGALA-SUIT', 'men', 'men-topwear', 2749, 'Tahvo (A Name To Trust) Is Your One Stop Destination For Making Any Given Day An Occasion. This Label Brings Together Couture Sensibilities And Timeless Style. We Understand That Your Clothes Are More Than Just To Show But They Are An Extension Of Your Personality.We Bring To You A Superfine Piece F', '2024-02-10', 'clothingsite/images/0003-1.jpeg', 'clothingsite/images/0003-2.jpeg', NULL, '', '', '', '', '', '', '', ''),
(4, 'NAMASKAR RAYON COTTON FULL SLEEVE CHIKANKARI SELF DESIGN KNEE LENGTH BLACK KURTA FOR MEN', 'men', 'men-topwear', 1499, 'We Are Presenting Here The Latest Designer Kurta Set Perfectly For Ethnic, Casual As Well As Party Wear. These Are Designed To Absolute Perfection, This Designer Kurta Set Looks Very Trendy To Show & That Too Keeps You At Ease Whenever You Wear These. These Have Exclusive Designs That Give You A Roy', '2024-02-10', 'clothingsite/images/0004-1.jpg', 'clothingsite/images/0004-2.jpg', NULL, '', '', '', '', '', '', '', ''),
(5, 'WHITE COTTON PLAIN STITCHED PATHANI SUITS', 'men', 'men-topwear', 999, 'Product Name	: White Cotton Plain Stitched Pathani Suits, Brand - Royal Kurta, Stitching Type - Stitched, Package Details - 1 Pathani Suits, Other Details :  Work - Plain, Sleeve - Full Sleeve, Top Color - White, Top Fabric - Cotton.', '2024-02-10', 'clothingsite/images/0005-1.jpg', 'clothingsite/images/0005-2.jpg', NULL, '', '', '', '', '', '', '', ''),
(6, 'GREEN PLAIN POLYCOTTON BANDHGALA-SUIT', 'men', 'men-topwear', 3299, 'Product Description : Fashion, Brand - Tahvo, Stitching Type	- Stitched, Package Details - 1 Blazer, Other Details : Embellish - Solid, Work - Plain, Top Color - Green, Top Fabric - Polycotton.', '2024-02-10', 'clothingsite/images/0006-1.jpeg', 'clothingsite/images/0006-2.jpeg', NULL, '', '', '', '', '', '', '', ''),
(7, 'Men Regular Fit Solid Spread Collar Casual Shirt', 'men', 'men-topwear', 299, 'Product Details :   Pack of -  1, Closure  - Button, Fit - Regular, Fabric-  Cotton Blend, Sleeve  - Full Sleeve, Pattern  - Solid, Reversible - No, Collar -  Spread, Color - Dark Green, Fabric Care  - Regular Machine Wash, Suitable For - Western Wear, Hem - Curved, Net Quantity  - 1.', '2024-02-10', 'clothingsite/images/0007-1.webp', 'clothingsite/images/0007-2.webp', 699, '', '', '', '', '', '', '', ''),
(8, 'Men Regular Fit Checkered Spread Collar Casual Shirt', 'men', 'men-topwear', 289, 'Surhi shirt for men is one of the top selling product from premium quality casual shirts collection exclusively manufactured by Surhi brand. Long lasting fabric and trendy colors make it evergreen for casual and formal usage. You can use it on jeans as well as it is appropriate as formal office wear. Acurate stitching by skilled workers gives it authentic classic look. You will love to wear it for multi purpose use as shirts boys men, shirt for men look, shirts for men stylish, casual shirt, shirts for men stylish look branded.', '2024-02-10', 'clothingsite/images/0008-1.webp', 'clothingsite/images/0008-2.webp', 599, '', '', '', '', '', '', '', ''),
(9, 'Men Printed, Graphic Print, Typography Round Neck Cotton Blend White T-Shirt', 'men', 'men-topwear', 174, 'White printed T-shirt, has a round neck, short sleevesThe feel of this Roadster tee is absolutely amazing thanks to the designer\'s use of cotton. A fashionable weekend outfit starts with this white top matched with chinos and your favourite pair of sunglasses to cast an effortlessly cool image.', '2024-02-10', 'clothingsite/images/0009-1.webp', 'clothingsite/images/0009-2.webp', NULL, '', '', '', '', '', '', '', ''),
(10, 'Men Checkered Round Neck Cotton Blend Black T-Shirt', 'men', 'men-topwear', 329, 'Step up your Style Quotient by wearing this Casual T-shirt from LEWEL. Team it up with your favourite pair of jeans, denim shorts and sneakers when you head out to work, party, vacation or anything your heart desires. Itâ€™s your Life, your Rules and we will be all the way with you in style.', '2024-02-10', 'clothingsite/images/0010-1.webp', 'clothingsite/images/0010-2.webp', 729, '', '', '', '', '', '', '', ''),
(11, 'Men Solid Denim Jacket', 'men', 'men-topwear', 1102, 'Olive green solid denim jacket with distressed detail, has a spread collar, 4 pockets, has a button closure, long sleeves, straight hemline.', '2024-02-10', 'clothingsite/images/0011-1.webp', 'clothingsite/images/0011-2.webp', NULL, '', '', '', '', '', '', '', ''),
(12, 'Men Solid Jacket', 'men', 'men-topwear', 499, 'Product Details :  Color - White, Fabric - Cotton Blend, Pattern - Solid, Ideal for - Men, Sleeve - Full Sleeve, Closure - Button, Pack of - 1, Suitable for - Western Wear, Reversible - No, Type - Denim Jacket, Fabric care - Gentle Machine Wash, Net Quantity - 1.', '2024-02-10', 'clothingsite/images/0012-1.webp', 'clothingsite/images/0012-2.webp', NULL, '', '', '', '', '', '', '', ''),
(13, 'Men Solid Leather Jacket', 'men', 'men-topwear', 2497, 'Leather Retail Faux leather is usually associated with strength, authority, and elegance; now you can achieve the same characteristics with this wide range of Faux leather jacket for men inspired by the latest trends. The highly sophisticated men Faux leather jacket features some essential and decorative details like zipper/button closure, multiple pockets, internal viscous/Fur lining etc. These Faux leather jacket men can be worn for numerous occasions including fancy dress parties, outings, trips, etc. Attention: Please be aware that colors might look slightly different in person due to camera quality and monitor settings.', '2024-02-10', 'clothingsite/images/0013-1.webp', 'clothingsite/images/0013-2.webp', NULL, '', '', '', '', '', '', '', ''),
(14, 'Men Striped Round Neck Yellow Sweater', 'men', 'men-topwear', 357, 'Product Details :  Color - Yellow, Fabric - Acrylic, Neck - Round Neck, Pattern - Striped, Sleeve - Full Sleeve, Suitable For - Western Wear, Closure - No Closure, Pack of - 1, Ideal For - Men, Net Quantity - 1.', '2024-02-10', 'clothingsite/images/0014-1.webp', 'clothingsite/images/0014-2.webp', 599, '', '', '', '', '', '', '', ''),
(15, 'Men Solid Turtle Neck Maroon Sweater', 'men', 'men-topwear', 580, 'Product Details : Color - Maroon, Fabric - Acrylic Blend, Neck - Turtle Neck, Pattern - Solid, Sleeve - Full Sleeve, Suitable For - Western Wear, Closure - No Closure, Fabric Care - Regular Machine Wash, Pack of - 1, Ideal For - Men, Net Quantity - 1.', '2024-02-10', 'clothingsite/images/0015-1.webp', 'clothingsite/images/0015-2.webp', NULL, '', '', '', '', '', '', '', ''),
(16, 'Men Checkered Round Neck Grey Sweater', 'men', 'men-topwear', 551, 'Product Details  :  Color - Grey, Fabric - Acrylic Blend, Neck - Round Neck, Pattern - Checkered, Sleeve - Full Sleeve, Suitable For - Western Wear, Closure - No Closure, Pack of - 1, Ideal For - Men, Net Quantity - 1.', '2024-02-10', 'clothingsite/images/0016-1.webp', 'clothingsite/images/0016-2.webp', NULL, '', '', '', '', '', '', '', ''),
(17, 'Men Solid Hooded Neck Black Sweater', 'men', 'men-topwear', 499, 'Product Details :  Color - Black, Fabric - Fleece, Neck - Hooded Neck, Pattern - Solid, Sleeve - Full Sleeve, Suitable For - Western Wear, Closure - No Closure, Fabric Care - Hand Wash, Pack of - 1, Ideal For - Men, Net Quantity - 1.', '2024-02-10', 'clothingsite/images/0017-1.webp', 'clothingsite/images/0017-2.webp', NULL, '', '', '', '', '', '', '', ''),
(18, 'Men Solid Pure Cotton Straight Kurta  (Black)', 'men', 'men-topwear', 379, 'A men\'s solid kurta is a traditional Indian attire that exudes simplicity and elegance. It is a versatile garment that can be worn for various occasions, ranging from casual gatherings to formal events. The term \"solid\" refers to the color of the kurta, which is typically a single, uninterrupted shade without any intricate patterns or designs.The solid kurta is typically made from comfortable and breathable fabrics such as cotton, linen, silk, or blends, ensuring a relaxed and airy feel. It is characterized by its straight-cut silhouette, often reaching just above the knee or slightly below, and features a round neckline with a buttoned or slit placket.One of the distinctive features of a solid kurta is its minimalistic design, allowing the focus to remain on the color and fabric texture. This makes it a versatile piece of clothing that can be accessorized in various ways to achieve different looks. Men can pair a solid kurta with contrasting or complementary churidar pants, Aligarh pants, or even straight-cut trousers for a modern twist.Solid kurtas are often chosen in classic colors such as white, beige, black, navy blue, or earthy tones like olive green and maroon. However, the color options are virtually limitless, enabling individuals to select shades that resonate with their personal style and the occasion they are dressing for.For a casual look, a solid kurta can be worn with minimalistic footwear like sandals or slip-ons.', '2024-02-10', 'clothingsite/images/0018-1.webp', 'clothingsite/images/0018-2.webp', 499, '', '', '', '', '', '', '', ''),
(19, 'NFC CREATION EMBROIDERY AND SEQUINS WORK COTTON KURTA AND PAJAMA SET FOR BOYS', 'kids', 'boys_clothing', 1349, 'Product Description : Nfc Creation Embroidery And Sequins Work Cotton Kurta And Pajama Set For Boys Best For Ethnic Wear, Party Wear , Wedding Wear.  Other Details  : Pattern - Embroidery And Sequins Work, Work - Embroidered, Type - Kurta Pajama Sequins Work, Look - Fashion, Sleeve - Full Sleeve, Neck Style -Chinese Collar Kameez, Bottom Fabric - Cotton, Bottom Color - White, Top Color	- Red, Top Fabric - Cotton, Bottom Style - Pyjama, Gender - Boy.', '2024-02-10', 'clothingsite/images/0001.jpeg', 'clothingsite/images/0001-2.jpeg', NULL, '', '', '', '', '', '', '', ''),
(20, 'AMBA KURTA PYJAMA SET', 'kids', 'boys_clothing', 1360, 'Product Description : Featuring A Floral Printed Cotton Kurta In A Leafy Green Colour Paired With White Cotton Payjama. Colour : Green, Fabric : Cotton, Components : 2 ( Kurta , Pyjama), Work : Floral Printed.  Other Details :  Work - Printed, Look - Traditional, Sleeve - Full Sleeve, Top Color - Green, Top Fabric - Cotton, Gender - Boy..', '2024-02-10', 'clothingsite/images/0002.jpeg', 'clothingsite/images/0002-2.jpeg', NULL, '', '', '', '', '', '', '', ''),
(21, 'NFC CREATION PRINTED KURTA AND PAJAMA SET FOR BOYS BEST FOR ETHNIC WEAR, CASUAL WEAR, PARTY WEAR', 'kids', 'boys_clothing', 697, 'Product Description : Nfc Creation Printed Colored Kurta And Pajama Set For Boys Best For Ethnic Wear, Casual Wear, Party Wear, Daily Wea (Punjabi, Pajama, Punjabi Set, Kurta, Punjabi Pajama) Kurta Set.  Other Details : Pattern - Printed, Work - Printed, Type - Kurta Pajama  Block Print, Look - Traditional, Sleeve - Full Sleeve, Neck Style - Chinese Collar Kameez, Bottom Fabric - Dupion Silk, Bottom Color - Blue, Top Color - Grey, Top Fabric - Dupion Silk, Bottom Style - Pyjama, Gender - Boy.', '2024-02-10', 'clothingsite/images/0003.jpeg', 'clothingsite/images/0003-2_AmSCDP7.jpeg', NULL, '', '', '', '', '', '', '', ''),
