(25, 'BLUE PLAIN COTTON BOYS-BLAZER', 'kids', 'boys_clothing', 1919, 'Product Description	Tahvo (A Name To Trust) Is Your One Stop Destination For Making Any Given Day An Occasion. This Label Brings Together Couture Sensibilities And Timeless Style A Blazer Or Suit Jacket Is A Versatile Item Of Clothing Which You Can Wear On Casual Or Formal Occasions. A Blazer Is Generally Distinguished From A Sport Coat As A More Formal Garment And Tailored From Solid Colour Fabrics. This Blazer / Jacket For Men Has Two Side Slit Pockets With Flap That Can Be Inserted In The Pocket Or Kept Outside And One Breast Pocket That Also Has A Slit Design. The Pockets Are Not Only Functional But Also Enhance The Aesthetic Look Of The Blazer.', '2024-02-10', 'clothingsite/images/0007.jpeg', 'clothingsite/images/0007-2.jpeg', 2399, '', '', '', '', '', '', '', ''),
