(27, 'DOUBLE BREASTED NAVY BLUE BLAZER', 'kids', 'boys_clothing', 10000, 'Product Description : Double Breasted Navy Blue Blazer With Dotted Thread Design All Over With Off White Pants.  Other Details : Work - Embroidered, Type - Boys Blazers  Hand Embroidery, Look - Designer, Bottom Style - Trouser, Sleeve - Full Sleeve, Neck Style - Round Neck, Bottom Fabric - Cotton, Bottom Color - Off White, Top Color - Blue, Top Fabric - Cotton, Gender - Boy.', '2024-02-10', 'clothingsite/images/0009.jpg', 'clothingsite/images/0009-2.jpg', NULL, '', '', '', '', '', '', '', ''),
